import React from 'react';
import './App.css';
function App() {
  return (
    <div className="app">
      <div className="header">
        <div className="container">
          <h1>Hello world</h1>
        </div>
      </div>
      <div className="body">
        <div className="container">
          <h2>Body</h2>
        </div>
      </div>
      <div className="footer">
        <div className="container">
          <h3>Footer</h3>
        </div>
      </div>
    </div>
  );
}

export default App;
